INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("お！\nあそこに困ってそうな人発見！", 1.4, 1001, 0, 1, "春咲 ひより", 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, 2, 1);
