INSERT INTO `v1_23feeaf07b49606c2b4ed5ad308d63c6ff1e42cb5eef6f52b1a97562c7b05943` VALUES ("我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1.4, 1009, 0, 1, "柊杏奈", 1, "フッ…聞いて後悔するがいい！", 0, 0, "人呼んで「疾風の冥姫」!!", 0, 0, 2, 1);
